-- ----------------------------
-- Table structure for `stmall_good`
-- ----------------------------
DROP TABLE IF EXISTS `stmall_good`;
CREATE TABLE `stmall_good` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `good_id` int(7) NOT NULL,
  `barcode` char(14) NOT NULL,
  `category_id` varchar(10) NOT NULL,
  `good_name` varchar(30) NOT NULL,
  `good_spec` varchar(20) DEFAULT NULL,
  `good_price` decimal(6,3) NOT NULL,
  `good_pur_price` decimal(6,3) DEFAULT NULL,
  `units` char(2) DEFAULT NULL,
  `good_belong` varchar(30) DEFAULT NULL,
  `good_num` int(11) DEFAULT NULL,
  `status` tinyint(4) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`,`good_id`),
  KEY `idx_name` (`good_name`) USING BTREE,
  KEY `idx_category_status` (`category_id`,`status`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=22223 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of stmall_good
-- ----------------------------

-- ----------------------------
-- Table structure for `stmall_good_category`
-- ----------------------------
DROP TABLE IF EXISTS `stmall_good_category`;
CREATE TABLE `stmall_good_category` (
  `id` tinyint(4) NOT NULL AUTO_INCREMENT,
  `category_id` varchar(10) NOT NULL,
  `name` varchar(20) NOT NULL,
  `status` tinyint(4) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`,`category_id`)
) ENGINE=MyISAM AUTO_INCREMENT=128 DEFAULT CHARSET=utf8;

